import React from "react";
import './Home.css'
import { Box, Container, Input } from "@mui/material";
import Instalogo from '../Assets/instagram-logo.png';

export const Home = () => {
  return (
    <>
      <Container>
        <Box
          sx={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            height: "100vh",
          }}
        >
          <Box
            sx={{
              height: "450px",
              width: "350px",
              border: "1px solid grey",
              padding: "25px 39px 25px 39px",
            }}
          >
            <Box className="instagram_content_center">
              <img src={Instalogo} alt="" />
            </Box>
            <Box>
            <Input placeholder="Phone number, username, or email" inputProps={ariaLabel} />
            </Box>
          </Box>
        </Box>
      </Container>
    </>
  );
};
